import React from 'react';
import Hero from '../components/Hero/Hero';
import { InfoData } from '../data/InfoData';
import { SliderData } from '../data/SliderData'
import Bulk from '../components/Bulk'

const Home = () => {
    return (
        <>
        <Hero slides={SliderData}/>
        <Bulk {...InfoData}/>   
        </>
    )
}

export default Home;
